/* eslint-disable no-param-reassign */

const { URUGUAY_TD1 } = require('../formats');

const { getValidLines } = require('../checkLines');
const getResult = require('../getResult');
const uruguayTD1Fields = require('./uruguay-firlds');

module.exports = function parseUruguayTD1(mrzLines) {
  const lines = getValidLines(mrzLines, 3, 30, URUGUAY_TD1);

  return getResult(URUGUAY_TD1, lines, uruguayTD1Fields);
};
